import React,{useEffect} from "react";
import ImageCard from "../ImageCard/ImageCard";
import { useDispatch, useSelector } from "react-redux";
import {getAllImages, fetchAsyncImages} from "../../features/Images/imageSlice";
import './Tree.css';

const Tree = (props) => {
    const {data}=props;
    const dispatch = useDispatch();

    useEffect(()=>{
        dispatch(fetchAsyncImages(data));
    },[dispatch]);

    const images = useSelector(getAllImages);
    // let renderImages= "";
    const renderImages =images.hits.map((image, index) => {
      return( 
        <ImageCard key={index} data={image} />
      );
      });
    return (
        <div className="container">
            <div className="image-container">{renderImages}</div>
        </div>
    );
};

export default Tree;
